        List<String> res = new ArrayList<>();
        Stack<Character> stack = new Stack<>();
        for (int i = 0; i < words.length; i++) {
            StringBuilder sb = new StringBuilder();
            stack.push(words[i].charAt(words[i].length() - 1));
            while (!stack.isEmpty()) {
                sb.append(stack.pop());
            }
